    type: select
    proxies:
      - 🌐Direct
  - name: China
    type: select
    proxies:
      - 🌐Direct
      - 🇸🇬 [VMESS]Amazon
  - name: Singapore
    type: select
    proxies:
      - 🌐Direct
      - 🇸🇬 [VMESS]Amazon
  - name: Netflix
    type: select
    proxies:
      - 🌐Direct
      - 🇸🇬 [VMESS]Amazon
  - name: Disney+
    type: select
    proxies:
      - 🇸🇬 [VMESS]Amazon
      - 🇸🇬 [SS]WebHorizon
  - name: TV
    type: select
    proxies:
      - 🌐Direct
      - 🇸🇬 [VMESS]Amazon
  - name: Speedtest
    type: select
    proxies:
      - 🌐Direct
      - 🇸🇬 [VMESS]Amazon
  - name: 🛡Guard
    type: select
    proxies:
      - ⛔️Reject
      - 🌐Direct
  - name: 🌐Direct
    type: select
    proxies:
      - DIRECT
  - name: ⛔️Reject
    type: select
    proxies:
      - REJECT
